### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Time Complexity and Big-O Notation**
- **Concepts**: Understanding the time complexity of algorithms, including best-case, average-case, and worst-case scenarios.
- **Principles**: Big-O notation is used to describe the upper bound of an algorithm's running time.
- **Equations**:
  - \(O(n \log n)\)
  - \(O(n)\)
  - \(O(\log n)\)
  - \(O(n^2)\)

#### 2. **Sorting Algorithms**
- **Concepts**: Different sorting algorithms and their time complexities.
  - **Insertion Sort**: Worst-case time complexity of \(O(n^2)\).
  - **Merge Sort**: Stable sorting algorithm with \(O(n \log n)\) time complexity.
  - **Quick Sort**: Average-case time complexity of \(O(n \log n)\) and worst-case of \(O(n^2)\).
  - **Selection Sort**: Time complexity of \(O(n^2)\).
- **Principles**: Stability in sorting algorithms, divide-and-conquer approach, pivot selection in Quick Sort.

#### 3. **Binary Search**
- **Concepts**: Binary search algorithm and its time complexity.
- **Principles**: Maximum number of comparisons in the worst-case scenario.
- **Equations**: \(O(\log n)\)

#### 4. **Linked Lists**
- **Concepts**: Operations on linked lists, including insertion, deletion, and traversal.
- **Principles**: Pointer manipulation, handling arbitrary nodes.

#### 5. **Graph Algorithms**
- **Concepts**: Breadth-First Search (BFS) and Depth-First Search (DFS).
- **Principles**: BFS tree, levels in BFS, back edges in DFS, topological ordering.
- **Equations**: Levels in BFS, number of back edges in DFS.

#### 6. **Hash Tables**
- **Concepts**: Hash functions, collision resolution techniques (e.g., linear probing).
- **Principles**: Handling collisions, inserting and retrieving elements.
- **Equations**: Hash function \( h(k) = k \mod M \).

#### 7. **Recursion**
- **Concepts**: Recursive functions and their call stacks.
- **Principles**: Tracing recursive calls, counting the number of recursive calls.

#### 8. **Stacks and Queues**
- **Concepts**: Operations on stacks and queues, including push, pop, enqueue, and dequeue.
- **Principles**: Managing data structures, order of operations.

